The simulations studies shown here in @fig-boot-stats replicated what @Molinaro2005p47 found; the 632+ estimator has bias properties about the same as 10-fold cross-validation. 

How do these bias corrected estimators work when there is extreme overfitting? One way to tell is to consider a 1-nearest neighbor model. In this case, re-predicting the training set predicts every data point with its outcome value (i.e., a "perfect" model). For the Brier score, this means $\hat{Q}_{rsub}$ is zero. @tbl-bootstrap-bias shows the rest of the computations. For this model $Q\approx$ 0.17 and the ordinary estimate comes close: $\hat{Q}_{bt}$ = 0.174. 

The 632 estimate is $\hat{Q}_{632} = 0.632\,\hat{Q}_{bt} =$ 0.11; this is too much bias reduction as it overshoots the true value by a large margin. The 632+ estimator is slightly better. The ROR value is higher (0.351) leading to a higher weight on the ordinary estimator to produce $\hat{Q}_{632+}$ = 0.126.

Should we use the bootstrap to compare models? Its small variance is enticing, but the bias remains an issue. The bias is likely to change as a function of the magnitude of the metric. For example, the bootstrap’s bias is probably different for models with 60% and 95% accuracy. If we think our models will have about the same performance, the bootstrap (with a bias correction) may be a good choice. Note that @Molinaro2005p47 found that the 632+ estimator may not perform well when the training set is small (and especially of the number of predictors is large).

Let's take a look at a few specialized resampling methods. 

<a href="https://tidymodels.aml4td.org/chapters/resampling.html#sec-bootstrap">{{< fa brands r-project size=Large >}}</a>

## Time Series Data {#sec-time-series-resampling}

Time series data [@Hyndmanforecast] are sequential observations ordered over time. The most common example is daily stock prices. These data are a special case due to _autocorrelation_: rows of the data set are not independent. This can occur for many different reasons (e.g. underlying seasonal trends, etc.), and this dependency complicates the resampling process in two primary ways.  We need to think more carefully about how analysis and assessment sets are created. 

 - Randomly allocating samples to these sets would deteriorate the relationships among the samples due to autocorrelation.  If the autocorrelation is important information related to the response, then random sampling will negatively impact a model's ability to uncover the predictive relationship with the response.
 - Placing newer data in the analysis set and older data in the assessment set would not make sense because of the time trends in the data.

_Rolling forecasting origin_ splitting [@tashman2000out] is a resampling scheme that mimics the train/test splitting pattern from @sec-basic-splitting where the most recent data are used in the assessment set. We would choose how much data (or what range of time) to use for the analysis and assessment sets, then slide this pattern over the whole data set. @fig-rolling-scheme illustrates this process where each block could represent some unit of time. For example, we might build the model on six months of data and then predict the next month. The next resample iteration could bump that forward by a month or some other period (so that the assessment sets can be distinct or overlapping).


::: {.cell layout-align="center"}
::: {.cell-output-display}
![A schematic of rolling origin resampling for time series data. Each box corresponds to a unit of time (e.g., day, month, year, etc.).](../premade/rolling.svg){#fig-rolling-scheme fig-align='center' width=55%}
:::
:::


We also have the choice to cumulatively expand the analysis data from the start of the training set to the end of the current slice.  For example, in Resample 2 of @fig-rolling-scheme, the model would be fit using samples 1-9; in Resample 3, the model would be fit using samples 1-10; and so on.  This approach may be useful when the number of periods of time are smaller and we would like to include as much of the historical data as possible in each resample.

We'll use rolling forecasting origin resampling in one of the upcoming case studies using the hotel rate data previously discussed in @sec-hotel-rates.

