## Spatial Data {#sec-spatial-resampling}

@sec-spatial-splitting described the problem of spatial correlation between locations and a method for creating an initial split for the forestation data. 

Like time-series data, the resampling scheme for this type of data emulates the initial splitting process. We could create groupings for the training set using the following methods: 

 - Clustering methods:  These methods create partitions of the data where points with spatial coordinates are closer to each other within the same cluster than to points in other clusters.
 - Grid-based methods: A grid of equally sized blocks, either rectangular or hexagonal, is created to encompass the training set points.

From these groupings, we can apply procedures similar to previous cross-validation variations:

- Leave-one-group-out resampling: This method creates as many resamples as there are groups. In each resample, data points from one group are used as the assessment set, while the remaining groups are used to train the model. This process repeats for each group.
- _V_-fold cross-validation: This method assigns each group to one of _V_ meta-groups (e.g., folds). In each of the _V_ iterations, one fold is left out as the assessment set, while the remaining folds are used to train the model.
- Repeated _V_-fold cross-validation: This method involves restarting the grouping process with a different random number seed, allowing for multiple rounds of V-fold cross-validation.

Each of these approaches can be augmented using a buffer to exclude very close neighbors from being used. 

Going back to our forestry data, we previously used hexagonal blocks to split the data (see @fig-forested-split). The same blocking/buffering scheme was re-applied to the training set in order to create a 10-fold cross-validation. Recall that a 25 x 25 grid was used. For the training set, some of these hexagons are missing all of their data (since they were previously added to the test set). Of the remaining grid points, we systematically assign them to the ten folds. @fig-forested-blockcv shows this process for the first fold. The figure shows the blocks of data, along with the corresponding buffer for this iteration of cross-validation. The purple blocks are, for the most part, not adjacent to one another. These are combined into the first assessment set. The other locations that are not in the buffers are pooled into the first analysis set. 


