## Grouped or Multi-Level Data {#sec-multilevel-resampling}

When rows of data are correlated for other reasons, such as those discussed in @sec-multilevel-splitting, we can extend the techniques described above. Consider the previously mentioned example of having the purchase histories of many users from a retail database. If we had a training set of 10,000 instances that included 100 customers, we could conduct _V_-fold cross-validation to determine which _customers_ would go into the analysis and assessment sets. As with the initial split, any rows associated with specific customers would be placed into the same partition (i.e., analysis or assessment). 

