## Frequently Asked Questions {#sec-resampling-faq}

The general concept of resampling seems clear and straightforward.  However, we regularly encounter confusion and commonly asked questions about this process.  In this section we will address these common questions and misconceptions.

#### Is it Bad to Get Different Results from Each Resample?   {#sec-resampling-faq-diff-results .unnumbered}

The point of resampling is to see how the model pipeline changes when the data changes. There is a good chance that some important estimates differ from resample to resample. For example, when algorithmically filtering predictors, you might get _B_ different predictor lists, and that’s okay. It does give you a sense of how much noise is in the part of your model pipeline.

It can be good to examine the distribution of resampling performance.  Occasionally, we may find a resample that has unusual performance with respect to the rest of the resamples.  This may merit further investigation as to why the resample is unusual.

#### Can/Should I Use the Individual Resampling Results to Change the Model Pipeline?   {#sec-resampling-faq-indiv .unnumbered}

We often hear questions about how to use the cross-validated results to define the model. For example, using the top _X_% of predictors selected during resampling as the final predictor set in a new model pipeline seems intuitive. 

One important thing to consider is that _you now have a different model pipeline than what was just resampled_. To understand the performance of your newly informed model, you need to resample a model pipeline that _algorithmically_ selects the _X_% of predictors and resample it.

Note that resampling the specific set of top predictors determined from the resamples is not appropriate.   We have seen this done many times before in the hopes of improving predictive performance.  Performance often improves for the assessment sets.  But the performance cannot be generalized to the test set or for other new samples.  The rule to determine the top set should be resampled, not the specific output of that rule.

For the original pipeline, the final predictor set is determined when you fit that pipeline on the training set. The resampling results tell you about what _could_ have happened; the training set results show what _did happen_.

#### What Happens to the _b_ Trained Models? Which One Should I Keep? {#sec-resampling-faq-keep .unnumbered}

The _B_ models fit within resampling are _only used_ to estimate how well the model fits the data. You don’t need them after that. You can retain them for diagnostic purposes though. As mentioned above, using the replicate models to look into how parts of the model change can be helpful. 

Also, if you are not using a single validation set, recall that none of these models are trained with the unaltered training set, so none would be the final model.  

#### Is this some Sort of Ensemble?  {#sec-resampling-faq-ensemble .unnumbered}

No. We'll talk more about ensembles in @sec-ensembles and how the assessment set predictions can be used to create an ensemble.  

#### Can I Accidentally Resample Incorrectly?  {#sec-resampling-faq-error .unnumbered}

Unfortunately, yes. As previously mentioned, improper data usage is one of the most frequent ways that machine learning models silently fail; that is, you won’t know that there is a problem until the next set of labeled data. A good example discussed in @sec-removing-predictors is @Ambroise2002p1493. 

If you are 

 - training _every_ part of your model pipeline after the initial data split and using _only_ the training set and, 

- evaluating performance with external data

the risk of error is low.

#### What is Nested Resampling? {#sec-resampling-faq-nested .unnumbered}

This is a version of where an additional layer of resampling occurs. For example, suppose you are using 10-fold cross-validation. Within each of the 10 iterations, you might add 20 bootstrapping iterations (that resamples the analysis set). That ends up training 200 distinct models^[We will refer to the first resample (10-fold CV) as the _outer_ resample and the bootstrap as the _inner_ resample.]. 

For a single model, that’s not very useful. However, as discussed in @sec-nested-resampling, there are situations where the analysis set is being used for too many purposes. For example, during model tuning, you might use resampling to find the best model _and_ measure its performance. In certain cases, that can lead to bad results for the latter task.  

Another example is recursive feature selection, where we are trying to rank predictors, sequentially remove them, and determine how many to remove. In this case, it's a good idea to use an outer resampling loop to determine where to stop and an inner loop for the other tasks.

We will see nested resampling in the next chapter.

#### Is Resampling Related to Permutation Tests? {#sec-resampling-faq-perm .unnumbered}

Not really. Permutation methods (@sec-permutations) are similar to resampling only in that they perform multiple calculations on different versions of the training set. 

We used permutation methods in the bootstrapping section to estimate the no-information rate. Otherwise, they won’t be used to evaluate model performance. 

#### Are Sub-Sampling or Down-Sampling the Same as Resampling?  {#sec-resampling-faq-subsample .unnumbered}

No. These are techniques to modify your training set (or analysis set) to rebalance the data when a classification problem has rare events. They’ll be discussed in @sec-imbalance-sampling.

#### Why Do I Mostly Hear About Validation Sets?  {#sec-resampling-faq-val .unnumbered}

As discussed in @sec-deep-learning, stereotypical deep learning models are trained on _very_ large sets of data. There is very little reason to use multiple resamples in these instances, and deep learning takes up a lot of space in the media and social media. 

Generally, every data set that is not massive could benefit from multiple resamples. 

